        /// <summary>
        /// Bloquea los componentes inicializados segun el permiso del usuario segun los casos de uso.
        /// </summary>
        /// <param name="permiso"></param>
        private void BloquearComponentes(EnumPermisoUsuario permiso) {
            // Visitante
            switch(permiso) {
                case EnumPermisoUsuario.Verificador:
                    buttonNuevoUsuario.Enabled = false;
                    buttonNuevoPool.Enabled = false;
                    break;

                case EnumPermisoUsuario.Analista:
                    buttonNuevoUsuario.Enabled = false;
                    buttonNuevoRequisito.Enabled = false;
                    buttonNuevoEnsayo.Enabled = false;
                    buttonNuevoLaboratorio.Enabled = false;
                    break;

                case EnumPermisoUsuario.Monitor:
                    buttonNuevoUsuario.Enabled = false;
                    buttonNuevoRequisito.Enabled = false;
                    buttonNuevoEnsayo.Enabled = false;
                    buttonNuevoLaboratorio.Enabled = false;
                    break;

                case EnumPermisoUsuario.Visitante:
                    buttonNuevoUsuario.Enabled = false;
                    buttonNuevoMuestreo.Enabled = false;
                    buttonNuevoLaboratorio.Enabled = false;
                    buttonNuevaMuestra.Enabled = false;
                    buttonNuevaArea.Enabled = false;
                    buttonNuevoEnsayo.Enabled = false;
                    buttonNuevoRequisito.Enabled = false;
                    buttonNuevoPool.Enabled = false;
                    break;

                default:
                    break;
            }
        }

